// ==/UserScript==

(function() {
    'use strict';
    if (window.self !== window.top) return;
    const defaultURLs = [
                {name:"咸鱼云解析",url:"https://jx.xymp4.cc/?url=",type:"default"},
                {name:"虾米",url:"https://jx.xmflv.com/?url=",type:"default"},
                {name:"虾米2",url:"https://jx.xmflv.cc/?url=",type:"default"},
                {name:"纯净1",url:"https://im1907.top/?jx=",type:"default"},
                {name:"B站1",url:"https://jx.jsonplayer.com/player/?url=",type:"default"},
                {name:"爱豆",url:"https://jx.aidouer.net/?url=",type:"default"}
            ];
    const currentPageURL = encodeURIComponent(window.location.href);
    const button = document.createElement('button');
    button.textContent = '选择解析接口';
    button.id = 'url-interface-button';
    Object.assign(button.style, {
        position: 'fixed',
        bottom: '20px',
        right: '20px',
        zIndex: '9999',
        padding: '10px 20px',
        backgroundColor: '#007bff',
        color: '#fff',
        border: 'none',
        borderRadius: '5px',
        cursor: 'pointer',
        fontSize: '14px',
        fontWeight: 'bold',
        boxShadow: '0 3px 10px rgba(0, 0, 0, 0.2)'
    });
    document.body.appendChild(button);
    const panel = document.createElement('div');
    panel.id = 'url-interface-panel';
    Object.assign(panel.style, {
        position: 'fixed',
        bottom: '80px',
        right: '20px',
        backgroundColor: '#fff',
        border: '1px solid #ccc',
        borderRadius: '8px',
        padding: '15px',
        boxShadow: '0 4px 15px rgba(0, 0, 0, 0.15)',
        display: 'none',
        zIndex: '9998',
        width: '500px',
        maxHeight: '70vh',
        overflowY: 'auto',
        fontFamily: 'Arial, sans-serif',
        color: '#fff'
    });
    document.body.appendChild(panel);
    const createColumnLayout = () => {
        const container = document.createElement('div');
        Object.assign(container.style, {
            display: 'grid',
            gridTemplateColumns: 'repeat(3, 1fr)',
            gap: '10px',
            marginBottom: '15px'
        });
        return container;
    };
    const createInterfaceLink = (item, isCustom = false) => {
        const linkContainer = document.createElement('div');
        linkContainer.style.position = 'relative';
        
        const link = document.createElement('a');
        link.href = item.url + currentPageURL;
        link.textContent = item.name;
        link.target = '_blank';
        link.title = item.url + currentPageURL;
        Object.assign(link.style, {
            display: 'block',
            padding: '10px 8px',
            borderRadius: '6px',
            textAlign: 'center',
            textDecoration: 'none',
            backgroundColor: isCustom ? '#fff3cd' : '#e9ecef',
            color: isCustom ? '#856404' : '#495057',
            border: `1px solid ${isCustom ? '#ffeaa7' : '#ced4da'}`,
            overflow: 'hidden',
            textOverflow: 'ellipsis',
            whiteSpace: 'nowrap',
            fontSize: '13px',
            transition: 'all 0.2s ease'
        });
        link.addEventListener('mouseover', () => {
            link.style.backgroundColor = isCustom ? '#ffeaa7' : '#d8e2e6';
            link.style.transform = 'translateY(-2px)';
            link.style.boxShadow = '0 4px 8px rgba(0, 0, 0, 0.1)';
        });
        link.addEventListener('mouseout', () => {
            link.style.backgroundColor = isCustom ? '#fff3cd' : '#e9ecef';
            link.style.transform = 'translateY(0)';
            link.style.boxShadow = 'none';
        });
        if (isCustom) {
            const deleteBtn = document.createElement('button');
            deleteBtn.textContent = '×';
            deleteBtn.title = '删除此接口';
            Object.assign(deleteBtn.style, {
                position: 'absolute',
                top: '-10px',
                right: '-10px',
                width: '18px',
                height: '18px',
                borderRadius: '50%',
                backgroundColor: '#dc3545',
                color: 'white',
                border: 'none',
                fontSize: '12px',
                lineHeight: '12px',
                cursor: 'pointer',
                padding: 0,
                display: 'flex',
                alignItems: 'center',
                justifyContent: 'center'
            });
            
            deleteBtn.addEventListener('click', (e) => {
                e.preventDefault();
                e.stopPropagation();
                const customURLs = GM_getValue('customURLs', []);
                const updatedURLs = customURLs.filter(url => url.name !== item.name || url.url !== item.url);
                GM_setValue('customURLs', updatedURLs);
                refreshPanel();
            });
            
            linkContainer.appendChild(deleteBtn);
        }
        
        linkContainer.appendChild(link);
        return linkContainer;
    };
    const addInstructions = () => {
        const instructions = document.createElement('div');
        instructions.innerHTML = `
            <h3 style="margin: 0 0 12px 0; font-size: 16px; color: #333; border-bottom: 2px solid #6f42c1; padding-bottom: 5px;">
                脚本功能说明
            </h3>
            <div style="background-color: #f8f9fa; padding: 12px; border-radius: 6px; margin-bottom: 15px; font-size: 13px; line-height: 1.5; color: #333;">
                <img src="data:image/png;base64,"/>
                <p>此脚本允许您将当前页面URL作为参数传递给不同的接口。</p>
                <p><strong>使用方法：</strong></p>
                <ol style="margin: 8px 0; padding-left: 20px;">
                    <li>打开视频页面，选好集</li>
                    <li>点击按钮跳转解析页面</li>
                    <li>关注公众号网络喵，会分享新接口</li>
                    <li>如需添加自定义接口，将需要key</li>
                    <li>关注微信公众号网络喵，发送key，可获取key，可编辑自定义接口</li>
                    <li>自定义接口可以在网络上查找</li>
                    <li>自定义接口会保存在本地，下次访问仍然可用</li>
                    <li>感谢关注！！！</li>
                </ol>
                <p><strong>URL格式：</strong>接口URL + 当前页面URL（自动编码）</p>
            </div>
        `;
        panel.appendChild(instructions);
    };
    const renderDefaultInterfaces = () => {
        const title = document.createElement('h3');
        title.textContent = '默认接口';
        Object.assign(title.style, {
            margin: '0 0 12px 0',
            fontSize: '16px',
            color: '#333',
            borderBottom: '2px solid #007bff',
            paddingBottom: '5px'
        });
        panel.appendChild(title);
        
        const container = createColumnLayout();
        defaultURLs.forEach(item => {
            container.appendChild(createInterfaceLink(item));
        });
        panel.appendChild(container);
    };
    const renderCustomInterfaces = () => {
        const customURLs = GM_getValue('customURLs', []);
        if (customURLs.length > 0) {
            const title = document.createElement('h3');
            title.textContent = '自定义接口';
            Object.assign(title.style, {
                margin: '25px 0 12px 0',
                fontSize: '16px',
                color: '#333',
                borderBottom: '2px solid #28a745',
                paddingBottom: '5px'
            });
            panel.appendChild(title);
            
            const container = createColumnLayout();
            customURLs.forEach(item => {
                container.appendChild(createInterfaceLink(item, true));
            });
            panel.appendChild(container);
        }
    };
    const addCustomInterfaceForm = () => {
        const formContainer = document.createElement('div');
        formContainer.style.marginTop = '25px';
        formContainer.style.color = '#333';
        
        const title = document.createElement('h3');
        title.textContent = '添加自定义接口';
        Object.assign(title.style, {
            margin: '0 0 12px 0',
            fontSize: '16px',
            color: '#333',
            borderBottom: '2px solid #ffc107',
            paddingBottom: '5px'
        });
        formContainer.appendChild(title);
        const nameGroup = document.createElement('div');
        nameGroup.style.marginBottom = '12px';
        const nameLabel = document.createElement('label');
        nameLabel.textContent = '接口名称:';
        nameLabel.style.display = 'block';
        nameLabel.style.marginBottom = '5px';
        nameLabel.style.fontWeight = 'bold';
        nameGroup.appendChild(nameLabel);
        const nameInput = document.createElement('input');
        nameInput.type = 'text';
        nameInput.placeholder = '输入接口名称';
        Object.assign(nameInput.style, {
            width: '100%',
            padding: '8px',
            borderRadius: '4px',
            border: '1px solid #ced4da',
            boxSizing: 'border-box'
        });
        nameGroup.appendChild(nameInput);
        formContainer.appendChild(nameGroup);
        const urlGroup = document.createElement('div');
        urlGroup.style.marginBottom = '12px';
        const urlLabel = document.createElement('label');
        urlLabel.textContent = '接口 URL:';
        urlLabel.style.display = 'block';
        urlLabel.style.marginBottom = '5px';
        urlLabel.style.fontWeight = 'bold';
        urlGroup.appendChild(urlLabel);
        const urlInput = document.createElement('input');
        urlInput.type = 'text';
        urlInput.placeholder = '输入接口 URL (不需要包含参数)';
        Object.assign(urlInput.style, {
            width: '100%',
            padding: '8px',
            borderRadius: '4px',
            border: '1px solid #ced4da',
            boxSizing: 'border-box'
        });
        urlGroup.appendChild(urlInput);
        formContainer.appendChild(urlGroup);
        const isVerified = GM_getValue('verified', false);
        let verifyInput;
        if (!isVerified) {
            const verifyGroup = document.createElement('div');
            verifyGroup.style.marginBottom = '12px';
            const verifyLabel = document.createElement('label');
            verifyLabel.textContent = '验证码（key）:';
            verifyLabel.style.display = 'block';
            verifyLabel.style.marginBottom = '5px';
            verifyLabel.style.fontWeight = 'bold';
            verifyGroup.appendChild(verifyLabel);
            verifyInput = document.createElement('input');
            verifyInput.type = 'text';
            verifyInput.placeholder = '输入验证码';
            Object.assign(verifyInput.style, {
                width: '100%',
                padding: '8px',
                borderRadius: '4px',
                border: '1px solid #ced4da',
                boxSizing: 'border-box'
            });
            verifyGroup.appendChild(verifyInput);
            formContainer.appendChild(verifyGroup);
        }
        const addButton = document.createElement('button');
        addButton.textContent = '添加接口';
        Object.assign(addButton.style, {
            width: '100%',
            padding: '10px',
            backgroundColor: '#28a745',
            color: 'white',
            border: 'none',
            borderRadius: '6px',
            cursor: 'pointer',
            fontSize: '14px',
            fontWeight: 'bold',
            transition: 'background-color 0.2s ease'
        });
        addButton.addEventListener('mouseover', () => {
            addButton.style.backgroundColor = '#218838';
        });
        addButton.addEventListener('mouseout', () => {
            addButton.style.backgroundColor = '#28a745';
        });
        addButton.addEventListener('click', function() {
            const interfaceName = nameInput.value.trim();
            const interfaceUrl = urlInput.value.trim();
            if (!interfaceName) {
                alert('请填写接口名称');
                return;
            }
            if (!interfaceUrl) {
                alert('请填写接口URL');
                return;
            }
            try {
                new URL(interfaceUrl);
            } catch (e) {
                alert('URL格式不正确，请确保包含http://或https://');
                return;
            }
            if (!GM_getValue('verified', false)) {
                const verificationCode = verifyInput.value.trim();
                if (verificationCode !== '322797byOQGD') {
                    alert('验'+'证'+'码'+'k'+'e'+'y'+'输'+'入'+'错'+'误');
                    return;
                }
                GM_setValue('verified', true);
            }
            const customURLs = GM_getValue('customURLs', []);
            const exists = customURLs.some(item => 
                item.name === interfaceName || item.url === interfaceUrl
            );
            if (exists) {
                alert('已存在相同名称或URL的接口');
                return;
            }
            customURLs.push({ 
                name: interfaceName, 
                url: interfaceUrl.endsWith('=') ? interfaceUrl : interfaceUrl + (interfaceUrl.includes('?') ? '&url=' : '?url=')
            });
            GM_setValue('customURLs', customURLs);
            nameInput.value = '';
            urlInput.value = '';
            refreshPanel();
            panel.scrollTop = panel.scrollHeight;
        });
        formContainer.appendChild(addButton);
        panel.appendChild(formContainer);
    };
    const refreshPanel = () => {
        panel.innerHTML = '';
        addInstructions();
        renderDefaultInterfaces();
        renderCustomInterfaces();
        addCustomInterfaceForm();
    };
    refreshPanel();
    button.addEventListener('click', () => {
        panel.style.display = panel.style.display === 'none' ? 'block' : 'none';
        if (panel.style.display === 'block') {
            refreshPanel();
        }
    });
    document.addEventListener('click', (e) => {
        if (panel.style.display === 'block' && 
            !panel.contains(e.target) && 
            e.target !== button) {
            panel.style.display = 'none';
        }
    });
    GM_addStyle(`
        #url-interface-button:hover {
            background-color: #0056b3 !important;
            transform: translateY(-2px);
            box-shadow: 0 5px 12px rgba(0, 0, 0, 0.25) !important;
        }
        #url-interface-panel input:focus {
            outline: none;
            border-color: #007bff !important;
            box-shadow: 0 0 0 2px rgba(0, 123, 255, 0.25) !important;
        }
        #url-interface-panel h3 {
            margin: 0 0 12px 0;
            font-size: 16px;
            color: #333;
            padding-bottom: 5px;
        }
        #url-interface-panel a {
            transition: all 0.2s ease;
        }
        #url-interface-panel a:hover {
            text-decoration: none !important;
        }
    `);
})();